import React from 'react'
import Navbar from './Navbar'
import Menu from './Menu'

class Main extends React.Component {
  render() {
    return (
      <div>
        <Navbar />
        <div class = "row">
          <div id = "menu" class = "col-sm-3">
            <Menu />
          </div>
          <div id = "content" class = "col-sm-7">
          </div>
        </div>
      </div>
    );
  }
}

export default Main
